const url = 'http://10.0.0.12/api/usuario/consulta.php';

fetch(url)
.then((resp)=>resp.json())
.then(data =>{
    //console.log(data)
let datos = data.datos
let Users = JSON.stringify(datos)
//console.log(js)
})
.catch(function(error){
  console.log(error);
});

export default Users;
